      .project-section {
        display: grid;
        grid-template-columns: 1fr 1fr;
        column-gap: 56px;
        row-gap: 30px;
        max-width: 1000px;

        .project-box {
          position: relative;
          padding: 30px;
          transition: all 0.3s ease-in-out;
          -webkit-background-size: cover;
          -moz-background-size: cover;
          -o-background-size: cover;
          background-size: cover;
          height: 400px;
          overflow: hidden;

          &:hover {
            -webkit-box-shadow: 11px 14px 38px 5px rgba(216, 218, 232, 1);
            -moz-box-shadow: 11px 14px 38px 5px rgba(216, 218, 232, 1);
            box-shadow: 11px 14px 38px 5px rgba(216, 218, 232, 1);
          }

          .grey-bg {
            background: #efefef;
            position: absolute;
            top: 0;
            bottom: 0;
            right: 0;
            left: 0;
            opacity: 0;
            transition: all 0.3s ease-in-out;

            &:hover {
              opacity: 0.9;

              .project-info{
                .project-details{
                  transform: translate3d(0, 0, 0);
                  opacity: 1;
                }
                .project-title{
                  transform: translate3d(0, 0, 0);
                  opacity: 1;
                }
              }
            }

          .project-info{
            padding: 56px;
            position: absolute;
            width: 100%;
            bottom: 0;

            .project-details{
              position: relative;
              font-size: 1rem;
              text-transform: capitalize;
              margin: 0 0 1rem;
              transform: translate3d(-100px, 0, 0);
              opacity: 0;
              transition: transform 0.3s ease-in-out;
            }

            .project-title{
              font-size: 1.8rem;
              text-transform: uppercase;
              font-weight: 700;
              transform: translate3d(-100px, 0, 0);
              opacity: 0;
              transition: transform 0.3s ease-in-out 0.1s;
            }

            .fa-arrow-alt-circle-right{
              position: absolute;
              bottom: 56px;
              right: 56px;
              font-size: 2rem;
            }
          }
          }

          cursor: pointer;
          h5 {
            font-weight: 500;
            font-size: 1.3rem;
            margin-bottom: 1rem;
          }

          p {
            font-weight: 300;
            font-size: 0.8rem;
            margin-bottom: 1rem;
          }
        }
      }
    }
  }
}

